import { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [isLoading, setIsLoading] = useState(true);
  const [coins, setCoins] = useState([]);

  useEffect(() => {
    fetch("https://api.coinpaprika.com/v1/tickers");
  }, []);

  return (
    <div>
      <h1>The Coins!</h1>
      {isLoading ? <div>Loading...</div> : <div>done</div>}
    </div>
  );
}

export default App;
